insert into localization ( id, kor, eng ) values ( N'map_busanjagalchi_desc',  N'어서오이소~! 부산의 정겨움을 만끽할 수 있는 자갈치시장이에요.',  N'Welcome! Jagalchi Market is where you can enjoy Busan''''s nostalgia.' );
insert into localization ( id, kor, eng ) values ( N'map_busansuhyup_desc',  N'부산 사람들의 신뢰를 받는 부산시 수협이에요. 번거롭게 은행에 갈 필요가 없어요!',  N'The Busan Suhyup is trusted by the people of Busan. No hassle of going to the bank!' );
