insert into faq ( id, question, answer) values ( 1,  N'아즈메타는 어떤 서비스인가요?',  N'아즈메타는 모두가 쉽게 참여할 수 있는 확장형 플랫폼으로 3차원 가상 세계에서 나만의 공간을 만들어 창작, 문화, 예술을 표현하고 NFT, 커머스와 같은 교류 수단을 통해 다양한 가상세계에서 경제활동 및 소통할 수 있는 메타버스 플랫폼입니다.' );
insert into faq ( id, question, answer) values ( 2,  N'아바타와 닉네임을 바꾸고 싶어요.',  N'좌측상단 ''''프로필 설정''''에서 수정 가능해요.' );
insert into faq ( id, question, answer) values ( 5,  N'[회의실]은 어떤 공간인가요?',  N'회의실은 회의룸이라는 공간을 생성하여 자료 공유 및 화상 채팅 등을 이용할 수 있으며, 서로 자유롭게 소통할 수 있는 회의/강연 커뮤니티 공간이예요' );
insert into faq ( id, question, answer) values ( 6,  N'[게임존]무한의 코드가 뭔가요?',  N'좌/우 (0 / 1) 버튼과 함정버튼을 시간 내 눌러 모두 매칭시키면 성공하는 게임이에요. 랭킹 경쟁을 통해 최후의 1인에 도전해보세요!' );
insert into faq ( id, question, answer) values ( 7,  N'[게임존]폴짝매칭이 뭔가요?',  N'바닥 그림카드의 이미지를 기억하고 스크린 이미지와 동일한 바닥 카드 위에 올라가면 살아남는 개인전 게임이에요. 최대 10라운드 게임에서 승리 또는 최후의 1인으로 살아남으면 승리할 수 있어요!' );
insert into faq ( id, question, answer) values ( 8,  N'[게임존]OX퀴즈가 뭔가요?',  N'스크린에 제시되는 질문에 O 또는 X 바닥카드로 이동하여 정답을 맞추면 살아남는 개인전 게임이에요!' );
insert into faq ( id, question, answer) values ( 9,  N'회원가입 시 어떤종류의 SNS를 이용할 수 있나요?',  N'가능한 소셜 간편 로그인으로는 네이버, 카카오, 구글, 애플이 있어요.' );
insert into faq ( id, question, answer) values ( 10,  N'여러 기기에 중복으로 로그인할 수 있나요?',  N'한 개의 계정으로 여러기기에 중복로그인은 불가해요.' );
insert into faq ( id, question, answer) values ( 11,  N'탈퇴는 없나요? 계정을 삭제하고 싶어요.',  N'우측상단 ''''설정>계정''''에서 탈퇴 가능해요.' );
insert into faq ( id, question, answer) values ( 12,  N'탈퇴한 아이디는 재가입 가능한가요?',  N'탈퇴 완료 이후 즉시, 재가입 가능해요.' );
insert into faq ( id, question, answer) values ( 13,  N'궁금한 점이 있거나 문의사항이 있으면 어디로 연락해야 하나요?',  N'궁금한 사항 있으시면 help.arzmeta@hancom.com 로 문의주세요' );
